<?php
use memeserver\Core\DataStructures\RouteData;

class BasicRouter extends \memeserver\Core\Router\Stock {
    const TEMP_INDEX_HTML = <<<INDEX_HTML
<!DOCTYPE html>
<html>
<head>
    <title>Memeserver!</title>
    <style>
    @font-face {
        font-family: 'Roboto Thin';
        src: url(data:application/font-woff2;charset=utf-8;base64,) format('woff2'),
        url(data:application/font-woff;charset=utf-8;base64,) format('woff');
        font-weight: normal;
        font-style: normal;
    }
    html {
        height: 100%;
    }
    body {
        position: relative;
        height: 100%;
        width: 100%;
        font-family: 'Roboto Thin';
        margin: 0;
    }
    main {
        position: relative;
        height: 100%;
        width: 100%;
        display: flex;
        align-items: center;
        justify-content: center;
        background: #3F51B5;
        color: #FFFFFF;
    }
    h1.title {
        font-weight: 100;
        text-transform: uppercase;
        font-size: 70px;
    }
    </style>
</head>
<body>
<main>
    <h1 class="title">
        Memeserver!
    </h1>
</main>
</body>
</html>
INDEX_HTML;

    /**
     * @RequestType=GET
     * @URI=/
     * @param RouteData $data
     * @return \memeserver\Core\DataStructures\HttpResponse
     */
    public function index(RouteData $data) {
        $response = $data->getResponse();
        $response
            ->setBody(static::TEMP_INDEX_HTML)
            ->setStatus(200)
            ->setContentType('text/html');
        return $response;
    }
}